  render: () => {
    const ROW_COUNT = 10000;
    return <div style={{
      height: "100vh",
      display: "flex",
      flexDirection: "column"
    }}>
        <div style={{
        display: "flex",
        flexDirection: "row"
      }}>
          <div style={{
          flex: 1
        }}>virtua</div>
          <div style={{
          flex: 1
        }}>react-virtualized</div>
        </div>
        <div style={{
        display: "flex",
        flexDirection: "row"
      }}>
          <ScrollInput count={ROW_COUNT} />
        </div>
        <div style={{
        display: "flex",
        flexDirection: "row",
        flex: 1,
        gap: 8
      }}>
          <List style={{
          flex: 1
        }}>
            {Array.from({
            length: ROW_COUNT
          }).map((_, i) => <ItemWithRenderCount key={i} index={i} />)}
          </List>
          <div style={{
          flex: 1
        }}>
            <ReactVirtualizedList count={ROW_COUNT} Component={ItemWithRenderCount} />
          </div>
        </div>
      </div>;
  }
